import Logovanje from './Logovanje';
import SviProizvodi from './SviProizvodi';


const App=()=>{
  return (
    <Router>
      <Switch>
          <Route exact path="/" component={PocetnaStranica}/>
          <Route path="/registracija" component={Registracija}/>
          <Route path="/logovanje" component={Logovanje}/>
          {/* <PrivateRoute path="/svi-proizvodi" component={SviProizvodi}/> */}
      </Switch>
    </Router>
  );
};

